-- test for overflow pages with index created before the inserts
create table test_overflow(id int auto_increment(1, 2), vc varchar(16384));

create index i_test_overflow_id_vc on test_overflow(id, vc);
create index i_test_overflow_vc on test_overflow(vc);


select left(vc, 20) from test_overflow where vc >= 'a';
select /*+ use_desc_idx */ left(vc, 20) from test_overflow where vc >= 'a';

drop table test_overflow;
